import React, { useState } from 'react';
import axios from 'axios';

function UploadForm() {
  const [excels, setExcels] = useState({
    combined_sources: null,
    official_instagram: null,
    official_facebook: null,
    keywords: null
  });
  const [image, setImage] = useState(null);
  const [customText, setCustomText] = useState("");
  const [date, setDate] = useState("");
  const [companyName, setCompanyName] = useState("");

  const handleExcelChange = (file, type) => {
    setExcels(prev => ({
      ...prev,
      [type]: file
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const formData = new FormData();
    Object.entries(excels).forEach(([type, file]) => {
      if (file) {
        formData.append("excel_files", file);
      }
    });
    formData.append("image", image);
    formData.append("custom_text", customText);
    formData.append("date", date);
    formData.append("company_name", companyName);

    const response = await axios.post("http://localhost:8000/generate-ppt/", formData, {
      responseType: 'blob',
    });

    // Download file
    const blob = new Blob([response.data], { type: "application/vnd.openxmlformats-officedocument.presentationml.presentation" });
    const url = window.URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = "report.pptx";
    a.click();
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label>Combined Sources Excel:</label>
        <input type="file" onChange={e => handleExcelChange(e.target.files[0], 'combined_sources')} accept=".xlsx" />
      </div>
      <div>
        <label>Official Instagram Excel:</label>
        <input type="file" onChange={e => handleExcelChange(e.target.files[0], 'official_instagram')} accept=".xlsx" />
      </div>
      <div>
        <label>Official Facebook Excel:</label>
        <input type="file" onChange={e => handleExcelChange(e.target.files[0], 'official_facebook')} accept=".xlsx" />
      </div>
      <div>
        <label>Keywords Excel:</label>
        <input type="file" onChange={e => handleExcelChange(e.target.files[0], 'keywords')} accept=".xlsx" />
      </div>
      <div>
        <label>Image:</label>
        <input type="file" onChange={e => setImage(e.target.files[0])} accept="image/*" />
      </div>
      <div>
        <label>Date:</label>
        <input type="date" value={date} onChange={e => setDate(e.target.value)} required />
      </div>
      <div>
        <label>Company Name:</label>
        <input type="text" value={companyName} onChange={e => setCompanyName(e.target.value)} placeholder="Enter company name" required />
      </div>
      <div>
        <label>Custom Text:</label>
        <input type="text" value={customText} onChange={e => setCustomText(e.target.value)} placeholder="Enter custom text" />
      </div>
      <button type="submit">Generate PPT</button>
    </form>
  );
}

export default UploadForm;
